import React, { Component } from 'react';

const Footer = () => {
    return (
        <footer id="footer">
            <div className="center">
                <p>
                    Grado en Ingeniería en Informática | Universidad del País Vasco
                </p>
            </div>
        </footer>
    );
}

export default Footer;
